import math from './resources/math.png';
import science from './resources/science.png';
import accomplishments from './resources/accomplishments.png';
import React from 'react';
import { withRouter } from "react-router-dom";
import "./Header.css";
import home from './resources/home.png';
class Image extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        return(
            <div>
                <img class="Image" src={this.props.name}></img>
                <p>{this.props.names}</p>
            </div>
        );
    }
}
class Header extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        return(
            <div className="Header">
                <Image history = {this.props.history} name={home} path="/About" names="Home"></Image>
                <Image history = {this.props.history} name={math} path="/Math" names="Math"></Image>
                <Image history = {this.props.history} name={science} path="/Science" names="Science"></Image>
                <Image history = {this.props.history} name={accomplishments} path="/Accomplishments" name = "Accomplishments"></Image>
            </div>
        )
    }
}
export default withRouter(Header);
